import React from 'react'

import styled from 'styled-components'

const StyledDyno = styled.div`
  background-color: black;
  color: white;
  height: 100vh;
`

const Dyno = ({ match } ) => {
  const { params } = match

  return (
    <StyledDyno>
      <h1> { params.text } </h1>
    </StyledDyno>
  )
}

export default Dyno
